  JHADFIELD, Dawn Gay (Sue) and SUTCLIFF, Paul Richard
  HADFIELD, Dawn Gay (Sue) and SUTCLIFF. Paul Richard (cont...)
  photo scrapbooks. She is Captain of the Senior Women's 3.5 tennis team which has won the local
  division for the last five years and the Georgia State Championship for three of those years. She and
  Paul have also represented Columbas Ga on a mixed doubles team at the State Championships,
  Paul has a Bachelors degree in Education and a Masters in Education with emphasis on History. He was a
  Major in the United States Army and was twice awarded the US Silver Star. He is currently employed as a
  civil servant working for the Department of the Army as an Organisational Analyst at Fort Benning,
  Georgia. He enjoys fishing and is a 'catch and release' fisherman. He made his first visit to New
  Zealand in 1995 and he and Sue enjoy having relatives stay with them.
  01> SUTCLIFF, Edward Paul m on 19.10.1985 to LOVETT, Catherine Paige
  b 16.09.1961
  b 28.10.1962
  Edward b. at Paris, France. Paige, d/o Wesley Eugene Lovett (b.
  24.09.1939, supervisor for the US Postal Service) and Dana Charlotte Hall
  (b. 02.01.1940, secretary to the General at Fort Benning, Georgia, US Army
  Base). Paige b, at Columbus, Georgia, USA. Address: 7 Greenfield Drive,
  Hudson, New Hampshire 03051, USA; Email: sutcliffnh@classic.msn.com.
  Edward was educated at Columbus College, Columbus, Georgia, USA and
  graduated in 1984 with a degree in Criminal Justice. He served as a police officer and detective
  for the Columbus Police Department during and after his time at college. He was the youngest
  detective in the Police Department (age 24) when he applied for, and was accepted to work as a
  Special Agent of the Federal Bureau of Investigation. He has served in the Casper, Wyoming office
  of the FBI and is currently assigned to the Boston, Massachusetts FBI Division. He is specialising
  in white collar crime investigations but has worked in all areas of criminal investigation.
  Paige was educated at Columbus College and the University of Georgia from which she graduated in
  1985, obtaining a degree in Statistics. She served as statistician for the United States Department
  of Army then worked for the US Internal Revenue Service and the US Department of Energy before
  leaving the workforce to care for her children. Paige is an accomplished musician. She studied the
  piano for twelve years and has performed for many church choirs.
